import React from 'react';
import { Nav, Button, input } from 'react-bootstrap';

const Header = () => {
    return (
        <header>
            <Nav className="navbar fixed-top navbar-expand-xl navbar-dark header_color">
                <div className="container-fluid">
                    <span className="navbar-brand mb-0 h1 header_title">奈良教育大学クロバス</span>
                    <Button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </Button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <a className="nav-link active" aria-current="page" href="/"><span>トップページ</span></a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="https://www.nara-edu.ac.jp/"><span>奈良教育大学ホームページ</span></a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="https://nuess.nisylvania.net/"><span>NUESS</span></a>
                            </li>
                        </ul>
                    </div>
                </div>
            </Nav>
        </header >
    );
};

export default Header;
